    <!-- Main Content -->

            <div class="inline-flex items-center justify-center p-3 bg-white rounded-full shadow-sm mb-6 border border-slate-100">
                <span class="material-symbols-outlined text-blue-600 mr-2">schedule</span>
                <span class="text-sm font-semibold text-slate-500 uppercase tracking-wider">Standard Local Time</span>
            </div>
            
            <!-- Digital Clock Display -->
            <div class="relative">
                <h1 id="main-time" class="text-7xl sm:text-9xl font-black text-slate-900 tracking-tight tabular-nums leading-none">

                        <div class="absolute left-1/2 bottom-2 w-1 h-4 bg-slate-400 -translate-x-1/2"></div> <!-- 6 -->
                        <div class="absolute top-1/2 left-2 w-4 h-1 bg-slate-400 -translate-y-1/2"></div> <!-- 9 -->

            </h3>

            </div>

    <script>
        // --- Configuration & State ---
        const state = {
            is24Hour: false,
            cities: [
                { 
                    name: 'New York', 
                    zone: 'America/New_York', 
                    image: '/gen?prompt=iconic+landmark+New+York+Statue+of+Liberty+minimalist+flat+vector+illustration+circle+icon&aspect=1:1',
                    desc: 'Eastern Standard Time'
                },
                { 
                    name: 'London', 
                    zone: 'Europe/London', 
                    image: '/gen?prompt=iconic+landmark+London+Big+Ben+Clock+Tower+minimalist+flat+vector+illustration+circle+icon&aspect=1:1',
                    desc: 'Greenwich Mean Time'
                },
                { 
                    name: 'Tokyo', 
                    zone: 'Asia/Tokyo', 
                    image: '/gen?prompt=iconic+landmark+Tokyo+Pagoda+Mount+Fuji+minimalist+flat+vector+illustration+circle+icon&aspect=1:1',
                    desc: 'Japan Standard Time'
                },
                { 
                    name: 'Sydney', 
                    zone: 'Australia/Sydney', 
                    image: '/gen?prompt=iconic+landmark+Sydney+Opera+House+minimalist+flat+vector+illustration+circle+icon&aspect=1:1',
                    desc: 'Australian Eastern Time'
                }
            ]
        };

        // --- DOM Elements ---
        const els = {
            mainTime: document.getElementById('main-time'),
            mainDate: document.getElementById('main-date'),
            ampm: document.getElementById('ampm'),
            hourHand: document.getElementById('hour-hand'),
            minuteHand: document.getElementById('minute-hand'),
            secondHand: document.getElementById('second-hand'),
            formatToggle: document.getElementById('format-toggle'),
            toggleKnob: document.getElementById('toggle-knob'),
            worldContainer: document.getElementById('world-clock-container')
        };

        // --- Helper Functions ---
        
        function formatTime(date, timeZone, is24) {
            const options = {
                hour: 'numeric',
                minute: '2-digit',
                second: '2-digit',
                hour12: !is24,
                timeZone: timeZone
            };
            
            // Use Intl.DateTimeFormat for robust timezone handling
            const formatter = new Intl.DateTimeFormat('en-US', options);
            const parts = formatter.formatToParts(date);
            
            const hour = parts.find(p => p.type === 'hour').value;
            const minute = parts.find(p => p.type === 'minute').value;
            const second = parts.find(p => p.type === 'second').value;
            const dayPeriod = parts.find(p => p.type === 'dayPeriod')?.value;

            return { hour, minute, second, dayPeriod };
        }

        function formatDate(date) {
            return date.toLocaleDateString('en-US', { 
                weekday: 'long', 
                year: 'numeric', 
                month: 'long', 
                day: 'numeric' 
            });
        }

        function updateClock() {
            const now = new Date();

            // 1. Update Main Digital Clock (Local)
            const localTime = formatTime(now, undefined, state.is24Hour);
            
            // Pad hours if 24h to ensure consistent width, or just keep natural
            els.mainTime.textContent = `${localTime.hour}:${localTime.minute}:${localTime.second}`;
            els.ampm.textContent = !state.is24Hour ? localTime.dayPeriod : '';
            els.mainDate.textContent = formatDate(now);

            // 2. Update Analog Clock
            const seconds = now.getSeconds();
            const minutes = now.getMinutes();
            const hours = now.getHours();

            // Calculate degrees
            const secondsDeg = ((seconds / 60) * 360);
            const minutesDeg = ((minutes / 60) * 360) + ((seconds/60)*6);
            const hoursDeg = ((hours / 12) * 360) + ((minutes/60)*30);

            // Apply transforms
            els.secondHand.style.transform = `translateX(-50%) rotate(${secondsDeg}deg)`;
            els.minuteHand.style.transform = `translateX(-50%) rotate(${minutesDeg}deg)`;
            els.hourHand.style.transform = `translateX(-50%) rotate(${hoursDeg}deg)`;

            // 3. Update World Clocks
            state.cities.forEach((city, index) => {
                const cityTime = formatTime(now, city.zone, state.is24Hour);
                const timeString = `${cityTime.hour}:${cityTime.minute}`;
                const periodString = !state.is24Hour ? cityTime.dayPeriod : '';
                
                const timeEl = document.getElementById(`city-time-${index}`);
                const periodEl = document.getElementById(`city-period-${index}`);
                
                if (timeEl) timeEl.textContent = timeString;
                if (periodEl) periodEl.textContent = periodString;
            });
        }

        function renderWorldClocks() {
            els.worldContainer.innerHTML = state.cities.map((city, index) => `
                <div class="bg-white rounded-2xl shadow-md p-6 flex flex-col items-center text-center hover:shadow-xl transition-shadow duration-300 border border-slate-100 group">
                    <div class="relative w-16 h-16 mb-4 overflow-hidden rounded-full ring-4 ring-slate-50 group-hover:ring-blue-50 transition-all">
                         <img src="${city.image}" alt="${city.name}" class="w-full h-full object-cover">
                    </div>
                    <h4 class="text-lg font-bold text-slate-800 mb-1">${city.name}</h4>
                    <p class="text-xs text-slate-400 font-medium uppercase tracking-wide mb-4">${city.desc}</p>
                    <div class="mt-auto bg-slate-50 rounded-lg py-2 px-6 w-full">
                        <span id="city-time-${index}" class="text-2xl font-mono font-bold text-blue-600">--:--</span>
                        <span id="city-period-${index}" class="text-sm font-bold text-blue-400 ml-1"></span>
                    </div>
                </div>
            `).join('');
        }

        // --- Event Listeners ---
        
        els.formatToggle.addEventListener('click', () => {
            state.is24Hour = !state.is24Hour;
            // Animate Toggle
            if (state.is24Hour) {
                els.toggleKnob.classList.add('translate-x-6');
                els.formatToggle.classList.replace('bg-slate-300', 'bg-blue-600'); // Add clear active state visual
            } else {
                els.toggleKnob.classList.remove('translate-x-6');
                els.formatToggle.classList.replace('bg-blue-600', 'bg-slate-300');
            }
            
            // Force immediate update
            updateClock();
        });

        // --- Initialization ---
        
        // Initialize format toggle background logic (default 12h = inactive color)
        els.formatToggle.classList.add('bg-slate-300'); 

        // Render Initial Static Content
        renderWorldClocks();

        // Start the clock loop
        setInterval(updateClock, 1000);
        
        // Initial call to avoid 1s delay
        updateClock();

    </script>
